import React, { useState } from 'react';

function ListeRecettesPage() {
    const [recipe, setRecipe] = useState({
        title: '',
        prepTime: '',
        cookTime: '',
        ingredients: [],
        instructions: ''
    });

    const [ingredient, setIngredient] = useState({
        name: '',
        quantity: '',
        unit: ''
    });

    const [quantityOptions] = useState([...Array(10).keys()]);
    const [unitOptions] = useState(['pièce', 'mL', 'cl', 'L', 'g', 'kg', 'cuillère à café', 'cuillère à soupe']);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setRecipe(prevRecipe => ({
            ...prevRecipe,
            [name]: value
        }));
    };

    const handleIngredientChange = (e) => {
        const { name, value } = e.target;
        setIngredient(prevIngredient => ({
            ...prevIngredient,
            [name]: value
        }));
    };

    const addIngredient = (e) => {
        e.preventDefault();
        setRecipe(prevRecipe => ({
            ...prevRecipe,
            ingredients: [...prevRecipe.ingredients, ingredient]
        }));
        setIngredient({
            name: '',
            quantity: '',
            unit: ''
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Vous pouvez ici ajouter du code pour traiter les données de la recette, par exemple, les enregistrer dans une base de données
        console.log('Nouvelle recette:', recipe);
        // Réinitialisation du formulaire après la soumission
        setRecipe({
            title: '',
            prepTime: '',
            cookTime: '',
            ingredients: [],
            instructions: ''
        });
    };

    return (
        <div>
            <h2>Créer une nouvelle recette</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="title">Titre de la recette:</label>
                    <input
                        type="text"
                        id="title"
                        name="title"
                        value={recipe.title}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="prepTime">Temps de préparation (en minutes):</label>
                    <input
                        type="number"
                        id="prepTime"
                        name="prepTime"
                        value={recipe.prepTime}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="cookTime">Temps de cuisson (en minutes):</label>
                    <input
                        type="number"
                        id="cookTime"
                        name="cookTime"
                        value={recipe.cookTime}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label>Liste des ingrédients:</label>
                    <ul>
                        {recipe.ingredients.map((ingredient, index) => (
                            <li key={index}>{`${ingredient.name}: ${ingredient.quantity} ${ingredient.unit}`}</li>
                        ))}
                    </ul>
                    <div>
                        <input
                            type="text"
                            placeholder="Nom de l'ingrédient"
                            name="name"
                            value={ingredient.name}
                            onChange={handleIngredientChange}
                            required
                        />
                        <select
                            name="quantity"
                            value={ingredient.quantity}
                            onChange={handleIngredientChange}
                            required
                        >
                            {quantityOptions.map(option => (
                                <option key={option} value={option}>{option}</option>
                            ))}
                        </select>
                        <select
                            name="unit"
                            value={ingredient.unit}
                            onChange={handleIngredientChange}
                            required
                        >
                            {unitOptions.map(option => (
                                <option key={option} value={option}>{option}</option>
                            ))}
                        </select>
                        <button onClick={addIngredient}>Ajouter l'ingrédient</button>
                    </div>
                </div>
                <div>
                    <label htmlFor="instructions">Instructions:</label>
                    <textarea
                        id="instructions"
                        name="instructions"
                        value={recipe.instructions}
                        onChange={handleChange}
                        required
                    />
                </div>
                <button type="submit">Ajouter la recette</button>
            </form>
        </div>
    );
}

export default ListeRecettesPage;
